export default function Image(icon, size) {
  return (
    <img
      className="Image"
      src={getImageURL(icon)}
      alt={icon.name}
      width={size}
      height={size}
    />
  );
}

function getImageURL(icon, size = 's') {
  return (
    'https://i.imgur.com/' +
    icon.imageId +
    size +
    '.jpg'
  );
}
